    false,nt"url": null,nt"notes": " n        This final performance evaluation
    is intended to provide an objective, rigorous, and evidence-based analysis of the
    Fostering Transparency Initiative's (FOTI) overall performance. Specifically, the
    evaluation will look to identify, review, and assess four key aspects by utilizing
    the following evaluation questions: nn1. Program Logic na. Were the original six
    program components relevant to the Timorese context? (e.g. were they based on initial
    analysis of assumptions, risks, and external factors?) nb. Were any changes made
    to the program logic during the implementation? If so, were they appropriate? nn2.
    Activities Designed and Implemented na. Were planned activities actually implemented?
    Why or why not? nb. Were any new activities designed and implemented? If so, why?
    nc. What was the effectiveness of activities? nn3. Influence on Changes in Knowledge,
    Attitudes, and Behaviors na. Did implemented activities lead to measurable outcomes,
    such as changes in knowledge, attitudes, or behavior? nn4. Sustainability & Lessons
    Learned na. Have key implemented activities been sustained? nb. What is the likelihood
    for future sustainability? nc. What are the key aspects of FOTI that should be continued
    in the near term? nd. Which aspects of FOTI would be appropriate to replicate in
    other contexts?n      ",nt"license_title": "License Not Specified",nt"extras":
